    false,nt"url": null,nt"notes": "This annual narrative report for Morris
    Wetland Management District outlines Refuge accomplishments during the 1993 calendar
    year.  The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    the master plan, compliance with environmental and cultural resource mandates, and
    research and investigations. Refuge administration is outlined; information about
    personnel, youth programs, manpower programs, volunteer programs, funding, safety,
    and technical assistance is given. Habitat management is also covered; subjects
    include wetlands, forests, croplands, grasslands, grazing, haying, fire management,
    pest control, and private lands. The wildlife section of the report discusses wildlife
    diversity, endangered and threatened species, waterfowl, shorebirds, raptors, game
    mammals, fisheries resources, scientific collections, animal control, and disease
    control. The public uses of the Refuge described in this report include outdoor
    classrooms, interpretive programs, hunting, fishing, trapping, wildlife observation,
    and law enforcement. The equipment and facilities section of the report provides
    information about new construction, rehabilitation, major maintenance, equipment
    replacement, communication systems, computer systems, and energy conservation. Items
    of interest are provided at the end.",nt"license_title": "License Not Specified",nt"extras":
